		if(B[i] != '1'): m += 1		

ans, poly = 0, poly_power_mod(poly, m, n + 1)
for k in range(n - m + 1):
	term = fact[n - m - k] * fact[n - m - k] % mod
	if k < len(poly):
		term *= poly[k] * fact[m]
	else : term = 0	
	term *= fact[n - m] * fact[n] * ifact[n - m - k] * ifact[n - m - k]
	ans += term

